const Note = (props) => {
  return (
    <div className="note">
      <p>{props.text}</p>
      <div id="note-footer">
        <span id="span">{props.date}</span>
        <i class="fa-regular fa-trash-can"></i>
      </div>
    </div>
  );
};

export default Note;
